INSERT INTO `t_help` (`id`, `category`, `question`, `answer`, `notes`, `author`, `pursuit`, `eventname`, `format`, `startdate`, `enddate`, `multirace`, `rank`, `active`, `upddate`, `updby`, `createdate`) VALUES
(1, 'reminder', 'Selecting a course for today', '\n            <p>The Sailing Committee has recommended courses for each of the cardinal wind directions. The\n                courses also include options for light winds and low tide conditions. Each course is shown as it\n                should be displayed on the course board and has some tips on how to position the inflatable buoys.\n            </p>\n\n            <p>The courses can be viewed by selecting the CourseFinder option on the Status Page</p>\n\n            <!-- p>A paper copy of the course guide should be on the OOD desk in the race box -\n                <a href=\"https://www.starcrossyc.org.uk/racing/apps/course-guide\" target=\"_blank\">there is an online\n                    version here\n                </a>\n            </p -->\n            <p>An online copy of the buoy locations <a\n                    href=\"https://www.starcrossyc.org.uk/racing/essentials/buoy-chart\" target=\"_blank\">can be found here\n            </a>\n            </p>\n        ', '\n        <p>As OOD you are of course free to come up with your own race course - but in this case please check your course with a member of the Sailing Committee</p>\n        ', 'Mark Elkington - SYC', 0, NULL, NULL, NULL, NULL, 0, 5, 1, '2023-04-15 18:40:16', '', '2023-04-15 18:40:16'),
(2, 'reminder', 'Some reminders on running a pursuit race', 'TO BE COMPLETED', '', 'Mark Elkington - SYC', 1, NULL, NULL, NULL, NULL, 0, 5, 1, '2023-09-18 16:59:05', '', '2023-04-15 18:40:16'),
(3, 'reminder', 'Managing Multiple Races', '            <p>Some suggestions if you are scheduled to run more than one race in a day at Starcross YC.\r\n            <p>\r\n            <p>First of all when setting the course for the first race - consider what changes you will make to the\r\n                course for subsequent races to keep it interesting for the competitors. It is generally relatively easy\r\n                to adjust the amount of running / broad reaching /and close reaching by simply changing a single buoy or\r\n                alternatively moving the inflatable buoys. Making these small changes will make it fairer for all types\r\n                of boat racing.\r\n            </p>\r\n            <p>Organise a briefing for competitors before the first race. Explain the following:</p>\r\n            <ul>\r\n                <li>you will try to turn around the races quickly - the aim will be that the warning signal for the\r\n                    second race will be made within 5 minutes of the last boat finishing the first race. If this is not\r\n                    possible a postponement will be signalled - the postponement will be cancelled no less than 3\r\n                    minutes before the warning signal for the first start.\r\n                </li>\r\n                <li>you will likely change the course between races - watch for Flag C and a sound signal</li>\r\n            </ul>\r\n            <p>\r\n                <b>FIRST RACE</b> - run this as usual - selecting the relevant race on the raceManager racebox PROGRAMME page. Do not let\r\n                this race overrun and be ready to shorten course as necessary. While the final few boats are finishing -\r\n                ask the safety boats to adjust the course for the second race.\r\n            </p>\r\n            <p>\r\n            Once all the boats have finished, PUBLISH the results (on the results page) even if there are still some\r\n                issues to resolve (this has the effect of taking a backup ciopy of all the results for safety). Take\r\n                note of any outstanding issues - but leave them until all the races are complete. Do NOT close the race\r\n                at this stage.\r\n            </p>\r\n            <p>\r\n                <b>SECOND RACE</b> - go back to the PROGRAMME page (click the green text on the left hand side of the top\r\n                 navigation bar) and select the second race and run it as normal. To restart the lights\r\n                box turn the power off for 30 seconds and then power on. You can now start the race as usual. Once all\r\n                the boats have finished this race, PUBLISH the results but do NOT close the race\r\n            </p>\r\n            <p>Now return to the racebox PROGRAMME page and select the first race again. Resolve any outstanding\r\n                issues with the results for this race and republish if necessary. You can now CLOSE this race. Repeat\r\n                the process for race 2.\r\n            </p>\r\n        ', '            <p>Note: leaving outstanding results issues until all races have been completed takes the pressure off the OOD\r\n                team trying to sort out the result for Race 1 while starting Race 2. Publishing the interim results\r\n                immediately after each race is complete - before correcting any issues - has the effect of creating a\r\n                safety backup of the data. It is a good idea to select \"no upload to the website\" when you select the\r\n                interim publishing option.\r\n            </p>\r\n        ', 'Mark Elkington - SYC', 0, NULL, NULL, NULL, NULL, 1, 6, 1, '2023-09-18 16:59:20', '', '2023-04-15 18:40:16'),
(4, 'pickrace', 'what is the PROGRAMME page for?', '\n            <p>This page presents the race(s) to be run today and allows you to pick the race you want to deal with. To\n                access the race just click the <b>RUN RACE</b> button and it will be presented in the browser window.\n            </p>\n            <p>To switch to another race from within raceManager - you can go back to this page by clicking the green <b>\n                racebox: “racename”\n            </b> link at the top left of each page. To go back to the race click the <b>BACK TO RACE</b> button.\n            </p>\n            <p>To check the format of any race on today’s programme - click the black ‘list’ icon within the relevant\n                race display.\n            </p>\n            <p>If the race you want to run is not shown then you can use the <b>ADD NEW RACE</b> button to add the race\n                to the raceManager system.\n            </p>\n        ', '\n            <p>Note:<p></p>At Starcross YC it will be <u>very unusual</u> if you need to add a new race to the programme\n                - probably worth checking with a member of the Sailing Committee before you do this\n            </p>\n            ', 'Mark Elkington - SYC', 0, NULL, NULL, NULL, NULL, 0, 0, 1, '2023-04-15 18:40:16', '', '2023-04-15 18:40:16'),
(5, 'pickrace', 'Where can I find the Sailing Instructions?', '\n            <p>The Starcross YC Sailing Instructions for club racing can be found on the club website <a\n                href=\"https://www.starcrossyc.org.uk/racing/essentials/sailing-instructions-v3\" target=\"_BLANK\">on this\n            page\n        </a>\n        ', '\n            <p>If you are running an event open to non-club members then it may have specific sailing instructions which\n            may be found on the SYC events page <a href=\"https://www.starcrossyc.org.uk/open-events\" target=\"_BLANK\">on\n            this page\n        </a>\n        ', 'Mark Elkington - SYC', 0, NULL, NULL, NULL, NULL, 0, 5, 1, '2023-04-15 18:40:16', '', '2023-04-15 18:40:16'),
(6, 'race', 'what is the STATUS page for?', '\n            <p>This page gives you information on the race you are about to run - specifically the race format (start\n                sequence, signals etc.). It also allows you to change some details (e.g. name of race officer)\n            </p>\n            <p>It also allows you to:</p>\n            <ul>\n                <li>Set the number of laps for each fleet</li>\n                <li>Send an email to the team responsible for managing your raceManager system</li>\n                <li>Mark the race as ABANDONED or CANCELLED</li>\n                <li>CLOSE the race when you have accounted for all competitors</li>\n                <li>RESET the entire race if you want to start again</li>\n            </ul>\n            <p>You will normally use this page at the beginning of your race officer duty to check the race format and\n                set laps - and at the end of the race to indicate if it was abandoned / cancelled or to close a\n                successfully completed race. You might also wish to send a message to the raceManager team to explain\n                any problems you had with the software or issues with the results.</p>\n            ', '', 'Mark Elkington - SYC', 0, NULL, NULL, NULL, NULL, 0, 0, 1, '2023-04-15 18:40:16', '', '2023-04-15 18:40:16'),
(7, 'race', 'how do I reset a race?', '\n            <p>If you really want to start the entire race again in raceManager there is a reset option on the STATUS\n                page. Click the\n                RESET button and then enter the confirmation word and click the submit button to activate the reset\n            </p>\n            <p>You will lose all the entries and laptimes that you have entered. However if you are using the SAILOR\n                application for collecting entries these will still be available for you to reenter in the normal\n                way.\n            </p>\n\n        ', '\n            <p>\n                <b>DO NOT USE THIS APPROACH if you have already started a fleet</b>\n                - if you still want to start the entire race again do the following, signal abandonment (instruct the\n                Safety Boats to\n                inform the competitors) and\n            </p>\n            <ul>\n                <li>stop the start sequence on the lights box (power off the lights box and then on again)</li>\n                <li>signal abandonment - red and orange beacons (instruct the Safety Boats to inform the competitors)\n                </li>\n                <li>use the raceManager RESET button as described above - then reload entries</li>\n                <li>change the course if necessary - use Flag C + two sound signals</li>\n                <li>restart the start sequence on the lights system and on raceManager - and run the rest of the race as\n                    normal\n                </li>\n            </ul>\n        ', 'Mark Elkington - SYC', 0, NULL, NULL, NULL, NULL, 0, 5, 1, '2023-04-15 18:40:16', '', '2023-04-15 18:40:16'),
(8, 'race,timer,results', 'how do I ABANDON a race?', '\n            <p>You can abandon a race at any time from the STATUS page - just click the Abandon button. You can also change\n                your mind and unabandon the race as long as you continued to record lap times\n            </p>\n            <p>Once the race is abandoned you can then CLOSE the race - do NOT publish the partial results.</p>\n        </answer>\n        <p>\n            <b>IMPORTANT ... at Starcross YC our Sailing Instructions allow us to CURTAIL a club race rather than\n                abandon it.\n            </b>\n        </p>\n        <p>You SHOULD use this approach if all the boats still racing in a fleet have finished at least one lap as\n            this allows us to salvage a race result from a race that would otherwise be lost. It is most often used\n            if the wind dies to nothing towards the end of a race. To CURTAIL a race go to the results page and\n            use the Change Finish Lap option - this will have the following effect:\n        </p>\n        <ul>\n            <li>average lap racing: set the finish lap to the last one that the leading boat in the fleet\n                completed\n            </li>\n            <li>handicap/class racing: set the finish lap to the one that all boats in the fleet have completed</li>\n        </ul>\n        ', '\n        <p>Note: This function can also be useful if you have forgotten to shorten the race in raceManager, but have\n            signalled a finish to competitors. Simply set the finish lap to the shortened number of laps.</p>\n            ', 'Mark Elkington - SYC', 0, NULL, NULL, NULL, NULL, 0, 10, 1, '2023-04-15 18:40:16', '', '2023-04-15 18:40:16'),
(9, 'entries', 'what is the ENTRIES page for?', '\n            <p>This page allows you to enter boats into the race and manage the entries.</p>\n            <p>If you are using the sailor signon system in raceManager then you can use the LOAD ENTRIES button to load\n                everybody who signs on. When the button flashes red it means that there are some entries waiting to be\n                loaded.\n            </p>\n            <p>Alternatively you can use the ENTER BOATS button to search the database for boats to enter. You can\n                search for the sail number, class name, or helms surname. The system will find all matches in the\n                database and then you can select the boats to enter.\n            </p>\n            <p>The entries will be shown for each fleet as a separate tab - click the tab to see a fleet entries. You\n                can edit an entry - changing the crew, sail number, or handicap for this race only. You can also mark a\n                competitor for doing a club duty - they will be allocated points for the race according to the way your\n                raceManager system is configured.\n            </p>\n            <p>If you have new boats (i.e not in the database), or a new class of boat you should use the REGISTER NEW\n                CLASS and/or REGISTER NEW BOAT buttons to add the details to the database. Once in the database you can\n                enter them in the normal way.\n            </p>\n            <p>Finally you can use the PRINT ENTRIES button to get a list of entries in a variety of formats.</p>\n        ', '\n            <p>Note:<p></p>When you press the timer start button on the START page it will collect any late entries from\n                the sailor signon system automatically.\n            </p>\n        ', 'Mark Elkington - SYC', 0, NULL, NULL, NULL, NULL, 0, 0, 1, '2023-04-15 18:40:16', '', '2023-04-15 18:40:16'),
(10, 'entries', 'I cannot find the boat I want to enter', '\n            <p>This generally only occurs if your club does not use the raceManager SAILOR application to allow the\n                competitor to create their own entry or if you hae a new competitor that unfamiliar with the SAILOR application.\n            </p>\n\n            <p>The Enter Boat button on the ENTRIES page allows you to search using sail number, class name, or helm\n                surname. If you cannot find the boat you are looking for it is probably because it is not in the\n                raceManager database. In this case you will need to add the new boat using the Register New Boat button\n                - just fill in the form.\n            </p>\n            <p>Important - after registering the new boat you will still need to use the Enter Boat button to enter it in the normal\n                way.\n            </p>\n        ', '\n            <p>In very rare cases you may have a new boat which belongs to a class that is not recognised by raceManager.\n                In this case use the Register Class button first to create the new class. Then use he Register New Boat\n                button to create the new boat in the new class, and finally use the Enter Boat button to ener it into\n                the race.\n            </p>\n            ', 'Mark Elkington - SYC', 0, NULL, NULL, NULL, NULL, 0, 5, 1, '2023-04-15 18:40:16', '', '2023-04-15 18:40:16'),
(11, 'start', 'what is the START page for?', '\n            <p>This page is used to start the race timer and manage the start sequence.</p>\n            <p>Use the START TIMER button to start the raceManager clock at the same time as you make the first WARNING\n                signal (e.g. 6 minute gun) for the first fleet in the start sequence. This will start the master\n                countdown clock - and the individual fleet start countdowns. Once the countdowns to each start is\n                complete the clocks will show the elapsed time for each fleet.\n            </p>\n            <p>If you want to stop the clock and reset the start sequence (e.g if you decide to change the course) -\n                click the Timer button again (it will ask you to confirm the action by typing “stop”).\n            </p>\n            <p>30 seconds before each fleet starts the “Start Infringements” and “General Recall” buttons will be\n                enabled. Use the START INFRINGEMENTS button to record start line infringements such as OCS, DNS, DNC\n                etc.. If you decide to have a general recall use the GENERAL RECALL button to enter the wall clock time\n                for the actual start time of the fleet in question</p>\n        ', '\n            <p>Note:</p>\n            <ul>\n                <li>If you forget to start the Timer when you begin the flags/lights start sequence - use the “Forgot to\n                    start the timer” button. This will allow you to enter the wall clock time that you actually began\n                    the start sequence.\n                </li>\n                <li>The timer displays for each fleet will flash 30 seconds before each start to alert you to an\n                    upcoming start .\n                </li>\n            </ul>\n            ', 'Mark Elkington - SYC', 0, NULL, NULL, NULL, NULL, 0, 0, 1, '2023-04-15 18:40:16', '', '2023-04-15 18:40:16'),
(12, 'start', 'I forgot to start the Timer', '\n            <p>This is a relatively common mistake.</p>\n            <p>use the \"Forgot to Start Timer\" button on the TIMER page. This will allow you to enter the clock time\n                (hh:mm:ss) for the time you should have started the timer - i.e. the time you made the first signal in\n                the start sequence.\n            </p>\n        ', '\n            <p>Obviously you should try to input an accurate time for the first signal - but it does not need to be\n                accurate to within a few seconds - small errors are unlikely to have a significant impact on the results.\n            </p>\n        ', 'Mark Elkington - SYC', 0, NULL, NULL, NULL, NULL, 0, 5, 1, '2023-04-15 18:40:16', '', '2023-04-15 18:40:16'),
(13, 'start', 'How do I handle a general recall?', '\n            <p>If you signal a general recall for a fleet - that fleet must restart after remaining fleets have\n                started.   Use the following procedure:\n            </p>\n            <ul>\n                <li>restart the lights system (power off / power on) - set the number of starts to 1 (or however many fleets you have recalled)</li>\n                <li>start the recalled start sequence on the light box (take a note of the time of the warning signal</li>\n                <li>if you want to use the black flag - hoist at the 3 minute sound signal</li>\n                <li>on the START page in raceManager click the General Recall option for the fleet(s) in question - enter the clocktime (hh:mm:ss) of the start gun for the recalled fleet (i.e. the time you notes + 6 minutes)</li>\n                <li>. . . continue to run the race as normal</li>\n            </ul>\n        ', '', 'Mark Elkington - SYC', 0, NULL, NULL, NULL, NULL, 0, 10, 1, '2023-04-15 18:40:16', '', '2023-04-15 18:40:16'),
(14, 'timer', 'what is the TIMER page for?', '\n            <p>This is the page where you record lap times for each boat - and you will spend most of the race on this\n                page.\n            </p>\n            <p>The default display uses the Tabbed fleet organisation - click the relevant tab to view a fleet. To time\n                a lap - just click the watch next to the relevant boat and the lap time will appear. Colour shading is\n                used to indicate which boats are no longer racing, or on their last lap, or finished.\n            </p>\n            <p>You can also do the following for each boat:</p>\n            <ul>\n                <li>Delete (UNDO) the last lap time recorded</li>\n                <li>Set a scoring code (e.g. DNF, NSC etc.)</li>\n                <li>Edit the lap times</li>\n                <li>Add the boat to the ‘bunch’ list to help manage</li>\n                <li>Finish the boat at a lap other than the finish lap - average lap racing only.</li>\n            </ul>\n            <p>To shorten the course for one fleet - click the blue button above the list of boats - the race will then\n                finish on the next lap. Alternatively you can click the SHORTEN ALL FLEETS button on the right of the\n                page. This will shorten all fleets at their next lap.\n            </p>\n            <p>If you have many fleets and many competitors you may benefit from using one of the alternative TIMER\n                views - click the CHANGE VIEW option on the black menu bar. This will then give you the option of\n                condensed views which will allow you to see all boats racing without having to scroll or change tabs.\n                The three condensed views are organised by:\n            </p>\n            <ul>\n                <li>\n                    <b>Sail Number</b>\n                    - best option for lots of boats (50+)\n                </li>\n                <li>\n                    <b>Class</b>\n                    - best option if you have relatively few classes\n                </li>\n                <li>\n                    <b>Fleet</b>\n                    - best option if fleets tend not to be mixed up on the race course\n                </li>\n            </ul>\n            <p>Most of the functions of the tabbed display are available. Time laps by clicking the relevant boat button\n                - or use the gear wheel menu to get the other functions. You can switch between the different views at\n                any time. If you have relatively few classes the class view is probably the best option.</p>\n            ', '\n            <p>Note:</p>\n            <ul>\n                <li>The BUNCH facility is very useful to deal with groups of boats crossing the line in a bunch -\n                    further details are available in the separate help topic\n                    <b>“how do I use the BUNCH facility?”</b>\n                </li>\n            </ul>\n        ', 'Mark Elkington - SYC', 0, NULL, NULL, NULL, NULL, 0, 0, 1, '2023-04-15 18:40:16', '', '2023-04-15 18:40:16'),
(15, 'timer', 'I forgot to Shorten the course?', '\n            <p>It is a common mistake to signal a shortened course but forget to shorten the course in raceManager. You\n                signal the boats finish with the hooter, but they are not finished by raceManager\n            </p>\n            <p>This can easily be corrected after the race. On the RESULTS page find the \"Change Finish Lap\" function on\n                the right hand side of the screen. Click this and it will show the finish lap set for each fleet. Simply\n                set the actual finish lap for the fleet(s) you forgot to shorten and raceManager will automatically set\n                the boats to finished.\n            </p>\n            <p>For example if you had originally set the finish lap for fleet 1 to lap 4, but actually finished the\n                boats on lap 3 - just change the finish lap to 3.\n            </p>\n        ', '', 'Mark Elkington - SYC', 0, NULL, NULL, NULL, NULL, 0, 5, 1, '2023-04-15 18:40:16', '', '2023-04-15 18:40:16'),
(16, 'timer', 'How do I correct a lap time?', '\n            <p>On the TIMER page - using the TABBED view find the boat for which you want to make the correction.\n                Click the edit icon (pencil) and the lap times recorded for that boat will be shown. Edit the incorrect\n                lap times by entering the correct elapsed time in hh:mm:ss format.\n            </p>\n            <p>When you have completed the corrections - click the Update Lap Times button to apply them.</p>\n            <p>If you want to add a missed lap - just click the boat record to get a new lap - then use the edit button\n                again to make the relevant corrections to each lap.\n            </p>\n        ', '\n            <p>If the error you want to correct is a finishing time (i.e. for a boat on the last lap) - the edit function on the\n                RESULTS page provides a more comprehensive mechanism to correct this time and make other changes (e.g. no. of laps, apply\n                penalty points, change PY number, add crew name etc.)\n            </p>\n        ', 'Mark Elkington - SYC', 0, NULL, NULL, NULL, NULL, 0, 10, 1, '2023-04-15 18:40:16', '', '2023-04-15 18:40:16'),
(17, 'pursuit', 'what is the PURSUIT page for?', 'TO BE COMPLETED', '', 'Mark Elkington - SYC', 0, NULL, NULL, NULL, NULL, 0, 0, 1, '2023-04-15 18:40:16', '', '2023-04-15 18:40:16'),
(18, 'results', 'what is the RESULTS page for?', '\n            <p>This page allows you to check the race results and correct any mistakes, before publishing them . Once\n                published you can print the race results (and updated series results where relevant). The results will\n                also be made available on the club website.\n            </p>\n            <p>The results for each fleet are accessed in the normal way using the relevant tab at the top of the page.\n                The tabs include an indication of whether the results are complete or have problems that need resolving\n                (normally one or more boats who haven’t been finished or given a scoring code such as DNF). When you\n                click a fleet tab the system, when relevant, will present a list of possible problems with the results.\n            </p>\n            <p>You can correct the results - setting scoring codes and using the edit option to update details about the\n                competitor and their finishing time and no. of laps completed.\n            </p>\n            <p>Once you are happy the results are complete and correct - use the PUBLISH button to produce the results\n                files that you can print and will be automatically posted to the club website. As part of this process\n                you will need to add information on the wind conditions during the race and select some options for the\n                results process.</p>\n            ', '\n            <p>Note:</p>\n            <ul>\n                <li>You can correct and publish the results multiple times as necessary until the race is CLOSED on the\n                    status page.\n                </li>\n                <li>You can publish the results even if there are still outstanding warnings - but the results files\n                    will not be posted to the website - use the REPORT ISSUE button to send a message to your\n                    raceManager team.\n                </li>\n                <li>If you want to correct any of the lap times other than the finishing lap go to the TIMER page and\n                    use the edit option for the competitor in question.\n                </li>\n                <li>The results page gives you an option to change the lap used to finish each fleet - this can be\n                    useful if you signalled a shortened course and finished the boats, but forgot to record that\n                    shortened course in raceManager. Further details are provided in the separate help topic “I forgot\n                    to shorten the course”.\n                </li>\n            </ul>\n            ', 'Mark Elkington - SYC', 0, NULL, NULL, NULL, NULL, 0, 0, 1, '2023-04-15 18:40:16', '', '2023-04-15 18:40:16');
